import React from 'react'
import { useNavigate } from 'react-router-dom'
import styles from './MainPage.module.css'
import logo from '../../assets/images/logo.jpg'

const MainPage = () => {
    const navigate = useNavigate()

    const handleNavClick = (page) => {
        navigate(`/${page.toLowerCase()}`)
    }

    const handleMouseEnter = (e) => {
        e.currentTarget.classList.add(styles.navTransition)
    }

    const handleMouseLeave = (e) => {
        e.currentTarget.classList.remove(styles.navTransition)
    }

    return (
        <div className={styles.wrapper}>
            <div className={styles.dtuText}>DTU</div>
            <div className={styles.navLines}>
                {['Home', 'About', 'Services', 'Contact'].map((page) => (
                    <div
                        key={page}
                        className={styles.navLineWrapper}
                        onClick={() => handleNavClick(page)}
                        data-page={page}
                        onhover
                        onMouseEnter={handleMouseEnter}
                        onMouseLeave={handleMouseLeave}
                    >
                        <div className={styles.navLine}>
                            <div className={styles.rhombus}></div>
                            <div className={styles.rhombus}></div>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    )
}

export default MainPage
